• Породична стамбена зграда број 1 - површине 71 m2, на КП.бр. 2717, број дела 1, у приватној својини са уделом 1/1
• Породична стамбена зграда број 2 - површине 35 m2, на КП.бр. 2717, број дела 2, у приватној својини са уделом 1/1 (напомена: по налазу проценитеља овај објекат је порушен и дата је основна вредност од по 5 евра по квадратном метру у динарској противвредности);
• Помоћна зграда (остава) – неукњижени објекат - површине 36 m2, на КП.бр. 2717, у приватној својини са уделом 1/1 (напомена: по налазу проценитеља овај објекат је неукњижен, који се не одржава и не користи и намена му је помоћна просторија – остава у оквиру домаћинства);
